import React from "react";
import styled from "styled-components";

const SeventhPage = () => {
  return (
    <Container>
      <img src="/images/model-s/model-s-red.jpg" alt="" />
    </Container>
  );
};

const Container = styled.div`
  height: 100vh;
  background: rgb(249, 249, 249);
  img {
    height: 60%;
  }
`;
export default SeventhPage;
